profile_positions.description:
Amsterdam is continu in beweging! Iedere dag vinden er ruim 800.000 verplaatsingen in en om Amsterdam met het OV plaats. Met een uitgebreid netwerk van tram-, bus- en metrolijnen en veerverbindingen over het IJ zorgt GVB dat alle reizigers veilig, snel en comfortabel op hun plaats van bestemming komen. GVB vervoert reizigers met 56 buslijnen (waarvan 12 nachtlijnen), 16 tramlijnen, 4 metrolijnen en 8 veerverbindingen. Als Teammanager ben ik verantwoordelijk voor het dagelijks contact met de flexpool van flexkrachten die werken als buschauffeur. Ik ben de schakel van Olympia tussen de flexkrachten, GVB en Olympia. 

Teammanager van de flexpool BUS binnen GVB. Grootte van de pool +/- 125 flexkrachten.
Mijn dagelijkse werkzaamheden bestaan o.a. uit:
- Poolbeheer;
- Analyseren en signaleren/anticiperen van/op trends;
- Optimaliseren van processen en verhelpen van knelpunten;
- Het voeren van beoordelings- en functioneringsgesprekken;
- Verzorging volledige personeelsadministratie;
- Oplossen van ad hoc vraagstukken van de klant;
- Contact onderhouden met diverse interne en externe afdelingen.
